  \"2016-07-27T22:48:01.785979\",\n\t\"name\": \"region-1-acoustic-bat-inventory-national-wildlife-refuges-in-eastern-oregon-eastern-washin\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Bat species were inventoried on National
  Wildlife Refuges in Eastern Oregon, Eastern Washington, and Idaho using acoustic
  methods.  Samples were collected between June 1 and September 5, during 2012 and
  2013.  Bats were sampled at water sources using Pettersson D500x bat detectors.
  \ Call files were processed with SonoBat Software (v3.1).  A total of 14 bat species
  were detected on 17 refuges sampled.  A bat species list was generated for each
  refuge.  Activity rates were calculated based on number of 5-second call files collected
  per sample night (sunset to 3.5 hours past sunset).  For each sample site, species
  composition was estimated by subtracting the number of vetted calls for each species
  by the total number of vetted calls for the site.  Maps and graphs present activity
  rates and species composition for each 124 sample sites.\",\n\t\"license_title\":
